class movieTicketManagement extends React.Component {
    state = {
        data: data,
        current: 1,
        pageSize: 6,
        shopVisible: false,
        chooseMovie: '',
        choosePlace: '',
        chooseDate: '',
        chooseBrand: '',
        chooseTime: '',
        place: [],
        date: [],
        brand: [],
        time: [],
        placeInputVisible: false,
        dateInputVisible: false,
        brandInputVisible: false,
        timeInputVisible: false,
        brandInputValue: ''
    };

    componentDidMount() {
        $.ajax({
            type: "post",
            url: "bookstoreApp/getAllMovie",
            async: true,
            success: function (data) {
                let dataSort = JSON.parse(data);
                dataSort.sort(function (a, b) {
                    return a.id - b.id;
                });
                this.setState({
                    data: dataSort,
                });
            }.bind(this)
        });
    }

    disabledDate = (current) => {
        // Can not select days before today and today
        return current < moment().startOf('day');
    };

    onPageChange = (page) => {
        this.setState({
            current: page
        })
    };

    onShowSizeChange = (current, pageSize) => {
        this.setState({
            pageSize: pageSize
        });
    };

    handleShopVisibleChange = (shopVisible) => {
        this.setState({
            shopVisible,
        });
    };

    changeMovie = (movie) => {
        this.setState({
            chooseMovie: movie.title,
            place: movie.place,
            choosePlace: "",
            chooseDate: "",
            chooseBrand: "",
            chooseTime: "",
            price: ""
        });
    };

    changePlace = (place) => {
        this.setState({
            choosePlace: place,
        });
        $.ajax({
            type: "post",
            url: "bookstoreApp/getMovieDate",
            data: {place: place, movie: this.state.chooseMovie},
            async: false,
            success: function (data) {
                this.setState({
                    date: JSON.parse(data),
                    choosePlace: place,
                    chooseDate: "",
                    chooseBrand: "",
                    chooseTime: "",
                    price: ""
                });
            }.bind(this)
        });
    };

    changeDate = (date) => {
        this.setState({
            chooseDate: date,
        });
        $.ajax({
            type: "post",
            url: "bookstoreApp/getMovieBrand",
            data: {place: this.state.choosePlace, movie: this.state.chooseMovie, date: date},
            async: false,
            success: function (data) {
                this.setState({
                    brand: JSON.parse(data),
                    chooseDate: date,
                    chooseBrand: "",
                    chooseTime: "",
                    price: ""
                });
            }.bind(this)
        });
    };

    changeBrand = (brand) => {
        this.setState({
            chooseBrand: brand,
        });
        $.ajax({
            type: "post",
            url: "bookstoreApp/getMovieTime",
            data: {
                place: this.state.choosePlace,
                movie: this.state.chooseMovie,
                date: this.state.chooseDate,
                brand: brand
            },
            async: false,
            success: function (data) {
                if (JSON.parse(data) === null) {
                    this.setState({
                        time: [],
                        chooseBrand: brand,
                        chooseTime: "",
                        price: 0
                    });
                }
                else {
                    let time = JSON.parse(data);
                    let price = time.splice(JSON.parse(data).length - 1, 1);
                    time.sort(function (a, b) {
                        return Date.parse(moment().format('YYYY-MM-DD') + ' '+  a) - Date.parse(moment().format('YYYY-MM-DD') + ' '+  b);//时间正序
                    });
                    this.setState({
                        time: time,
                        chooseBrand: brand,
                        chooseTime: "",
                        price: price
                    });
                }
            }.bind(this)
        });
    };

    changeTime = (time) => {
        this.setState({
            chooseTime: time,
        });
    };

    showPlaceInput = () => {
        this.setState({
                placeInputVisible: true
            }, () => this.placeInput.focus()
        );
    };

    showDateInput = () => {
        this.setState({
            dateInputVisible: true
        });
    };

    showBrandInput = () => {
        this.setState({brandInputVisible: true}, () => this.brandInput.focus());
    };

    showTimeInput = () => {
        this.setState({
            timeInputVisible: true
        });
    };

    handlePlaceInputChange = (value) => {
        let place = this.state.place;
        if (value && place.indexOf(value) === -1) {
            place = [...place, value];
            this.setState({
                place,
                placeInputVisible: false,
                shopVisible: true,
            });
        }
        else {
            message.error("该地区已存在!");
            this.setState({
                placeInputVisible: false,
                shopVisible: true,
            });
        }
    };

    handlePlaceInputConfirm = () => {
        this.setState({
            placeInputVisible: false,
        });
    };

    handleDateInputChange = (value) => {
        let date = this.state.date;
        if (value && date.indexOf(value.format("YYYY-MM-DD")) === -1) {
            date = [...date, value.format("YYYY-MM-DD")];
            date.sort(function (a, b) {
                return Date.parse(a) - Date.parse(b);//时间正序
            });
            message.error("电影场次添加成功!");
            this.setState({
                date,
                dateInputVisible: false,
                shopVisible: true,
            });
        }
        else {
            message.error("该日期已存在!");
            this.setState({
                dateInputVisible: false,
                shopVisible: true,
            });
        }
    };

    handleBrandInputChange = (e) => {
        this.setState({brandInputValue: e.target.value});
    };

    handleBrandInputConfirm = () => {
        const inputValue = this.state.brandInputValue;
        let brand = this.state.brand;
        if (inputValue && brand.indexOf(inputValue) === -1) {
            brand = [...brand, inputValue];
        }
        this.setState({
            brand,
            brandInputVisible: false,
            brandInputValue: '',
        });
    };

    handleTimeInputChange = (value) => {
        let time = this.state.time;
        if (value && time.indexOf(value.format("H") + ":00") === -1) {
            $.ajax({
                type: "post",
                url: "bookstoreApp/addMovieTicket",
                data: {
                    place: this.state.choosePlace,
                    movie: this.state.chooseMovie,
                    date: this.state.chooseDate,
                    brand: this.state.chooseBrand,
                    time:value.format("H") + ":00"
                },
                async: false,
                success: function (data) {
                    if (JSON.parse(data)) {
                        time = [...time, value.format("H") + ":00"];
                        time.sort(function (a, b) {
                            return Date.parse(moment().format('YYYY-MM-DD') + ' '+  a) - Date.parse(moment().format('YYYY-MM-DD') + ' '+  b);//时间正序
                        });
                        this.setState({
                            time,
                            timeInputVisible: false,
                            shopVisible: true,
                        });
                    }
                }.bind(this)
            });
        }
        else {
            message.error("该时间已存在!");
            this.setState({
                timeInputVisible: false,
                shopVisible: true,
            });
        }
    };

    placeInputRef = input => this.placeInput = input;
    brandInputRef = input => this.brandInput = input;

    getMovie = () => {
        let result = [];
        const {data, place, date, brand, time, current, pageSize, chooseMovie, choosePlace, chooseDate, chooseBrand, chooseTime, placeInputVisible, dateInputVisible, brandInputVisible, timeInputVisible} = this.state;
        data.forEach((movie, index) => {
            if (index >= (current - 1) * pageSize && index < current * pageSize) {
                result.push(<Card
                    key={movie.id}
                    hoverable
                    className="movie-card"
                    cover={<img style={{height: "300px"}} alt={movie.title} src={movie.src}/>}
                    actions={[<Icon type="eye"
                                    onClick={() => this.props.history.push('/home/' + this.props.match.params.userName + "/viewMovie/" + movie.id)}/>,
                        <Popover
                            placement="rightTop"
                            content={<div style={{overflow: "hidden"}}>
                                <div className="tags-panel container">
                                    <ul className="tags-lines">
                                        <li className="tags-line">
                                            <div className="tags-title">地点:</div>
                                            <ul className="tags">
                                                {place.map(place => <li key={place}
                                                                        className={place === choosePlace ? "active" : "normal"}>
                                                    <a onClick={() => this.changePlace(place)}>{place}</a></li>)}
                                                {placeInputVisible ? (
                                                    <Select
                                                        ref={this.placeInputRef}
                                                        showSearch
                                                        size="small"
                                                        style={{width: 200, marginLeft: "12px"}}
                                                        placeholder="城市名"
                                                        optionFilterProp="children"
                                                        onChange={this.handlePlaceInputChange}
                                                        onBlur={this.handlePlaceInputConfirm}
                                                        filterOption={(input, option) => option.props.children.toLowerCase().indexOf(input.toLowerCase()) >= 0}
                                                    >
                                                        {cityData.map(city => <OptGroup key={city[0]} label={city[0]}>
                                                            {city[1].map(name => <Option key={name}
                                                                                         value={name}>{name}</Option>)}
                                                        </OptGroup>)}
                                                    </Select>
                                                ) : (
                                                    <li className="normal border-box">
                                                        <a onClick={this.showPlaceInput}><Icon type="plus"/>新建城市</a>
                                                    </li>
                                                )}
                                            </ul>
                                        </li>
                                        <li className="tags-line tags-line-border"
                                            style={{display: [choosePlace === '' ? "none" : "block"]}}>
                                            <div className="tags-title">时间:</div>
                                            <ul className="tags">
                                                {date.map(date => <li key={date}
                                                                      className={date === chooseDate ? "active" : "normal"}>
                                                    <a onClick={() => this.changeDate(date)}>{date}</a></li>)}
                                                {dateInputVisible ? (
                                                    <DatePicker
                                                        disabledDate={this.disabledDate}
                                                        size="small"
                                                        style={{width: 200, marginLeft: "12px"}}
                                                        placeholder="放映日期"
                                                        onChange={this.handleDateInputChange}
                                                    />
                                                ) : (
                                                    <li className="normal border-box">
                                                        <a onClick={this.showDateInput}><Icon type="plus"/>新建日期</a>
                                                    </li>
                                                )}
                                            </ul>
                                        </li>
                                        <li className="tags-line tags-line-border"
                                            style={{display: [chooseDate === '' ? "none" : "block"]}}>
                                            <div className="tags-title">品牌:</div>
                                            <ul className="tags">
                                                {brand.map(brand => <li key={brand}
                                                                        className={brand === chooseBrand ? "active" : "normal"}>
                                                    <a onClick={() => this.changeBrand(brand)}>{brand}</a></li>)}
                                                {brandInputVisible ? (
                                                    <Input
                                                        ref={this.brandInputRef}
                                                        size="small"
                                                        style={{width: 200, marginLeft: "12px"}}
                                                        placeholder="放映品牌"
                                                        onChange={this.handleBrandInputChange}
                                                        onBlur={this.handleBrandInputConfirm}
                                                        onPressEnter={this.handleBrandInputConfirm}
                                                    />
                                                ) : (
                                                    <li className="normal border-box">
                                                        <a onClick={this.showBrandInput}><Icon type="plus"/>新建品牌</a>
                                                    </li>
                                                )}
                                            </ul>
                                        </li>
                                        <li className="tags-line tags-line-border"
                                            style={{display: [chooseBrand === '' ? "none" : "block"]}}>
                                            <div className="tags-title">场次:</div>
                                            <ul className="tags">
                                                {time.map(time => <li key={time}
                                                                      className={time === chooseTime ? "active" : "normal"}>
                                                    <a onClick={() => this.changeTime(time)}>{time}</a></li>)}
                                                {timeInputVisible ? (
                                                    <TimePicker
                                                        format="HH:mm"
                                                        minuteStep={60}
                                                        size="small"
                                                        style={{width: 200, marginLeft: "12px"}}
                                                        placeholder="放映品牌"
                                                        onChange={this.handleTimeInputChange}
                                                    />
                                                ) : (
                                                    <li className="normal border-box">
                                                        <a onClick={this.showTimeInput}><Icon type="plus"/>新建时间</a>
                                                    </li>
                                                )}
                                            </ul>
                                        </li>
                                    </ul>
                                </div>
                            </div>}
                            trigger="click"
                            visible={chooseMovie === movie.title ? this.state.shopVisible : false}
                            onVisibleChange={this.handleShopVisibleChange}
                        >
                            <Icon onClick={() => this.changeMovie(movie)} type="setting"/>
                        </Popover>]}
                >
                    <Card.Meta
                        title={<span style={{fontWeight: "bold"}}>{movie.title}</span>}
                        description={<span><Rate allowHalf defaultValue={movie.rate} disabled/><span
                            style={{color: "#ff5741"}}>评分:{movie.rate * 2}</span></span>}
                    />
                </Card>)
            }
        });
        return result;
    };

    render() {
        return (
            <div style={{fontWeight: "bold", overflow: "hidden"}}>
                <h1 className="movie-head">电影票管理</h1>
                <Divider orientation="left" style={{fontWeight: "bold", fontSize: "20px"}}>所有地区</Divider>
                <div style={{overflow: "hidden"}}>
                    {this.getMovie()}
                </div>
                <div>
                    <Pagination showQuickJumper showSizeChanger pageSizeOptions={['6', '12', '18']}
                                onShowSizeChange={this.onShowSizeChange} current={this.state.current}
                                defaultPageSize={this.state.pageSize} total={this.state.data.length}
                                onChange={this.onPageChange} style={{float: "right", marginRight: "50px"}}/>
                </div>
            </div>
        );
    }
}

export default movieTicketManagement;